import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/BookTour.css'; // Import custom CSS

const BookTour = () => {
  const [formData, setFormData] = useState({
    location: '',
    firstName: '',
    lastName: '',
    phone: '',
    email: '',
    desks: '',
    interest: '',
    startDate: '2025-01-20', // Default date
  });
  const navigate = useNavigate();

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // Check required fields
    if (!formData.interest || !formData.desks) {
      alert(
        "Heads up, we don't have any single person private offices at Work.Life! Please select 'Coworking' or add more desks to continue."
      );
      return;
    }

    navigate('/book-confirmation', { state: { bookingDetails: formData } });
  };

  return (
    <div className="book-tour">
      <h2>Book a tour</h2>
      <form className="tourBookingForm bookingFormfield">
        {/* Where Field */}
        <div className="form-group">
          <label htmlFor="location">Where?*</label>
          <select
            id="location"
            name="location"
            value={formData.location}
            onChange={handleInputChange}
            required
          >
            <option value="">Select location</option>
            <option value="Bermondsey">Bermondsey</option>
            <option value="Soho">Soho</option>
            <option value="Camden">Camden</option>
          </select>
        </div>

        {/* About You Fields */}
        <div className="form-group">
          <label>Tell us about you*</label>
          <div className="name-fields">
            <input
              type="text"
              name="firstName"
              placeholder="First name"
              value={formData.firstName}
              onChange={handleInputChange}
              required
            />
            <input
              type="text"
              name="lastName"
              placeholder="Last name"
              value={formData.lastName}
              onChange={handleInputChange}
              required
            />
          </div>
          <input
            type="tel"
            name="phone"
            placeholder="Phone"
            value={formData.phone}
            onChange={handleInputChange}
            required
          />
          <input
            type="email"
            name="email"
            placeholder="Work email"
            value={formData.email}
            onChange={handleInputChange}
            required
          />
          <input
            type="number"
            name="desks"
            placeholder="How many desks do you need?"
            value={formData.desks}
            onChange={handleInputChange}
            required
          />
        </div>

        {/* Interest Selection */}
        <div className="form-group">
          <label>What are you interested in?*</label>
          <div className="interest-options">
            <button
              type="button"
              className={formData.interest === 'Private Office' ? 'selected' : ''}
              onClick={() => setFormData({ ...formData, interest: 'Private Office' })}
            >
              Private office
            </button>
            <button
              type="button"
              className={formData.interest === 'Coworking' ? 'selected' : ''}
              onClick={() => setFormData({ ...formData, interest: 'Coworking' })}
            >
              Coworking
            </button>
          </div>
        </div>

        {/* Submit Button */}
        <div className="form-buttons">
          <button type="submit" className="submit-button" onClick={handleSubmit}>
            Book Me In!
          </button>
        </div>

        {/* Hidden Fields and Recaptcha */}
        <div
          className="g-recaptcha"
          data-sitekey="6LfhMjwmAAAAAH_fcAX-mQ0cA6PO8axkWsrr5Qau"
          data-selected-date={formData.startDate}
          data-interested-in={formData.interest}
          data-val="ccef1bfa8e"
          data-popup_text_how_many_desks_do_you_need="Heads up, we don't have any single person private offices at Work.Life! Please select 'Coworking' or add more desks to continue."
        ></div>
      </form>
    </div>
  );
};

export default BookTour;
